    def decrypt(self, e):
        cipher = AES.new(self.key.encode(), AES.MODE_CBC, self.iv.encode())
        plain_text = unpad(cipher.decrypt(bytes.fromhex(e)), AES.block_size)
        return plain_text.decode('utf-8')

    def encrypt(self, e):
        cipher = AES.new(self.key.encode(), AES.MODE_CBC, self.iv.encode())
        cipher_text = cipher.encrypt(pad(e.encode('utf-8'), AES.block_size))
        return cipher_text.hex()


